/*
Global variables for keeping and passing data between actions.
*/
const data = {
    "total_records": 0,
    "offset": 0,
    "limit": kaholo.execution.configuration.sf_limit,
    "object_fields": "",
    "insert_rows": "",
    "table_columns": ""
};
const COLUMN_MAPPING = kaholo.execution.configuration.column_mapping;

/*
This is a post-execution function in "CountRecords" action that retrieves the number of records for a specified Salesforce object.
*/
function countRecords() {
    const totalRecords = actions.CountRecords.result.totalSize;
    data["total_records"] = totalRecords;
}

/*
This is a post-execution function in "CountRecords" action that retrieves an array of SF object fields from the Kaholo configuration object and 
creates a string to paste into SOQL query.
*/
function getSalesforceObjectFields() {
    const objectFields = COLUMN_MAPPING.filter(item => item.sf_object_field !== null).map(item => item.sf_object_field).join(",");
    data["object_fields"] = objectFields;
}

/* 
This is a post-execution function in "SelectRecords" action that prepares data to be inserted into the database.
*/
function transformData() {
    const salesforceRecords = actions.SelectRecords.result.records;
    const objectFields = data["object_fields"].split(",");
    var insertRows = [];
    for (let record of salesforceRecords){
        let rowItems = [];
        for (let field of objectFields){
            rowItems.push(record[field]);
        }
        let row = `('${rowItems.join("','")}')`;
        insertRows.push(row);
    }
    data["insert_rows"] += insertRows.join(",");
    data["offset"] += data["limit"]
}

/*
This is a pre-execution function in "CreateTable" action that prepares table columns to be created.
*/
function createTableColumns() {
    const columnNames = COLUMN_MAPPING.filter(item => item.column_name !== "id").map(item => item.column_name).join(", ");
    const columnTypes = COLUMN_MAPPING.map(item => `${item.column_name} ${item.data_type}`).join(", ");
    data["column_types"] = columnTypes
    data["column_names"] = columnNames
}

